// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract DBeatsNFT is ERC721, ERC721URIStorage, Ownable {

    uint256 private _currentTokenId = 0;
    uint256 public _mintPrice;
    uint256 private _platformFeePercentage;
    uint256 public _royaltyFeePercentage;
    string public _uri;
    address public _artistAddress;
    address public _platformWalletAddress; //can set to private

    event RoyaltyPaid(address indexed artist, address indexed buyer, uint256 amount);
    event Minted(address indexed to, uint256 indexed tokenId, string uri);

    modifier onlyAdmin() {
        require(msg.sender == _platformWalletAddress, "Only platform admin wallet can call this function");
        _;
    }

    constructor(
        uint256 royaltyFeePercentage,
        address artistAddress,
        string memory _newTokenURI,
        string memory _name,
        string memory _symbol,
        uint256 mintPrice,
        uint256 platformFeePercentage,
        address platformWalletAddress
    ) ERC721(_name, _symbol) {
        _uri = _newTokenURI;
        _artistAddress = artistAddress;
        _mintPrice = mintPrice;
        _platformFeePercentage = platformFeePercentage;
        _platformWalletAddress = platformWalletAddress;
        _royaltyFeePercentage = royaltyFeePercentage;
    }

    function mint(address to, uint256 quantity) public payable {
        require(quantity > 0, "Quantity must be greater than 0");
        require(msg.value >= quantity * _mintPrice, "Insufficient ETH sent");
        uint256 fee = (msg.value * _platformFeePercentage) / 100;
        payable(_platformWalletAddress).transfer(fee);
        for (uint256 i = 0; i < quantity; i++) {
            _safeMint(to, _currentTokenId);
            emit Minted(to, _currentTokenId, tokenURI(_currentTokenId));
            _setTokenURI(_currentTokenId, _uri);
            _currentTokenId++;
        }
    }

    function updatePlatformFee(uint256 _newPlatformFeePercent) external onlyAdmin {
        _platformFeePercentage = _newPlatformFeePercent;
    }

    function withdraw() public onlyOwner {
        require(msg.sender == _artistAddress, "Only the artist can withdraw");
        payable(msg.sender).transfer(address(this).balance);
    }

    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return _uri;
    }

    function _baseURI() internal view override returns (string memory) {
        return _uri;
    }

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal override(ERC721) {
        if (from != address(0) && to != address(0)) {
            uint256 royaltyAmount = (msg.value * _royaltyFeePercentage) / 100;
            payable(_artistAddress).transfer(royaltyAmount);
            emit RoyaltyPaid(_artistAddress, to, royaltyAmount);
        }
        super._beforeTokenTransfer(from, to, tokenId);
    }
}

contracts/Factory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "./DBeatsNFT.sol";

contract DBeatsFactory is Ownable, AccessControl {
    uint256 public tokenCounter;
    address public platformWalletAddress;
    mapping(address => address[]) public nftsByCreator;

    // Define a new role identifier for the admin role
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

    event NewNFT(
        address indexed nftAddress,
         uint256 _royaltyFeePercentage,
        address _artistAddress,
        string _newTokenURI,
        string name,
        string symbol,
        uint256 mintPrice
    );

    constructor(address _platformWalletAddress)  AccessControl() {
        // Grant the admin role to the contract deployer
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        platformWalletAddress = _platformWalletAddress;
    }

    // Function to add a user to a specific role
    function addUserToRole(bytes32 role, address account) public onlyOwner {
        grantRole(role, account);
    }

    function createNFT(
        // address _admin,
        address _artistAddress,
        string memory _newTokenURI,
        string memory name,
        string memory symbol,
        uint256 mintPrice,
        uint256 _platformFeePercentage,
        uint256 _royaltyFeePercentage
    ) public {
        // Check that the caller has the admin role
        require(hasRole(ADMIN_ROLE, msg.sender), "Caller is not an admin");

        tokenCounter++;
        DBeatsNFT newNFT = new DBeatsNFT(
            // _admin,
            _royaltyFeePercentage,
            _artistAddress,
            _newTokenURI,
            name,
            symbol,
            mintPrice,
            _platformFeePercentage,
            platformWalletAddress
        );
    
        emit NewNFT(
            address(newNFT),
            _royaltyFeePercentage,
            _artistAddress,
            _newTokenURI,
            name,
            symbol,
            mintPrice
        );

        nftsByCreator[_artistAddress].push(address(newNFT));
    }

    // Function to get NFTs created by a specific address
    function getNFTsByCreator(address creator) public view returns (address[] memory) {
        return nftsByCreator[creator];
    }
}

